from pandas import DataFrame
from data_transformers import chain, transformer


#  DEFINITIONS_START
@transformer.convert
def sort_values_by_comparison(df, colname: str, precedence: dict, prefix=[], suffix=[]):
    mapcol = colname+'_map'
    df_ = df.copy()
    df_[mapcol] = df_[colname].map(precedence)
    df_ = df_.sort_values(by=[*prefix, mapcol, *suffix])
    return df_.drop(mapcol, axis=1)

@transformer.convert
def drop_col(df: DataFrame, col, axis=1):
    return df.drop(col, axis=axis)

@transformer.convert
def agrupar_y_sumar(df: DataFrame, col_indicador, col_anio):
    return df.groupby([col_indicador, col_anio]).sum().reset_index()

@transformer.convert
def join_dataset(df: pd.DataFrame, df2: str, how : str = 'left', on: str = None, left_on: str = None, right_on: str = None) -> pl.DataFrame:

    import polars as pl

    # Create safe eval context
    eval_context = {
        'pl': pl,
        'null': None,
        'None': None,
        '__builtins__': {}  # Restrict builtins for security
    }

    df2 = eval(df2, eval_context)

    if on is not None:
        return df.join(df2, how=how, on=on)
    else:
        return df.join(df2, how=how, left_on=left_on, right_on=right_on)

@transformer.convert
def rename_cols(df: DataFrame, map):
    df = df.rename(columns=map)
    return df

@transformer.convert
def multiplicar_por_escalar(df: DataFrame, col:str, k:float):
    df[col] = df[col]*k
    return df

@transformer.convert
def to_pandas(df: pl.DataFrame, dummy = True):
    df = df.to_pandas()
    return df
